import './App.css';
import React, { Component } from "react";
import FilteredList from './FilteredList';

const songs = [
  {title: "HIP", language: "Korean", artist: "MAMAMOO"},
  {title: "TOP", language: "Korean", artist: "Stray Kids"},
  {title: "Blueming", language: "Korean", artist: "IU"},
  {title: "Wake Me Up", language: "English", artist: "Avicii"},
  {title: "Rather Be", language: "English", artist: "Clean Bandit"},
  {title: "Flamingo", language: "Japanese", artist: "Yonezu Kenshi"},
  {title: "BL", language: "Japanese", artist: "Queen Bee"},
  {title: "Night Diver", language: "Japanese", artist: "Miura Haruma"},
  {title: "Ready Steady", language: "Japanese", artist: "Giga"},
  {title: "Sunflower", language: "Japanese", artist: "Orangestar"},
  {title: "Nocturne", language: "Chinese", artist: "Jay Chou"},
  {title: "Super star", language: "Chinese", artist: "SHE"}
];

export default class App extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div>
        <h1>Music Playlist</h1>
        <div><FilteredList list = {songs} /></div>
      </div>
    )
  }
}
